import React, { useEffect, useState } from "react"

const Fetch = () => {
  const [users, setUsers] = useState([])

  const fetchUserData = () => {
    fetch("http://172.22.81.182:8080/rfid/getprod?awb=12")
      .then(response => {
        console.log(response.json());
        return response.json()
      })
      .then(data => {
        setUsers(data)
      })
  }

  useEffect(() => {
    fetchUserData()
  }, [])

  return (
    <div>
      {users.length > 0 && (
        <ul>
          {users.map(user => (
            <li key={user.id}>{user.name}</li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Fetch;
